(t) + \"\\n--------------------------\\n\" +  getCode(t)\n  str\n}\n\ndef getFileName(tableVo) {\n    def tool = shell.parse(context.codeTableTemplateService.getById(1).code)\n    def t = tool.calcTable(tableVo)\n  if(t.approval != null) {\n    return \"src/main/java/\"+baseNamespace.replace(\".\", \"/\") + \"event/\" +\"${t.upperCamelCase}ApprovalEventListener.java\"\n  }\n  null\n}\n\ndef getCode(t) {\n  createCode(t)\n} \n\n//TODO 1 调整审批单号；2 调整整理审批通过，拒绝状态字段以及值 \ndef createCode(tableVo) {\n  def tool = shell.parse(context.codeTableTemplateService.getById(1).code)\n  def t = tool.calcTable(tableVo)\n  def fields = t.fields\n\n  //检查是否需要输出\n  if(t.approval == null) {\n    return null\n  }  \n\n  //获取审批ID\n  def applyId = tool.getPartData(t.approval, 0, \"~\", \"4\")\n  def idColumn = tool.getPartData(t.approval, 1, \"~\", \"id\")\n  \n  def  code = \"\"\n  //导入引入\n  code += \"package ${baseNamespace}event;\\n\" +\n          \"import lombok.RequiredArgsConstructor;\\n\" +\n          \"import lombok.extern.log4j.Log4j2;\\n\" +\n          \"import org.springframework.context.ApplicationListener;\\n\" +\n          \"import org.springframework.scheduling.annotation.Async;\\n\" +\n          \"import org.springframework.stereotype.Component;\\n\" +\n          \"import work.soho.approvalprocess.domain.ApprovalProcessOrder;\\n\" +\n          \"import work.soho.approvalprocess.event.ApprovalEvent;\\n\" +\n          \"import ${baseNamespace}domain.${t.upperCamelCase};\\n\" +\n          \"import ${baseNamespace}service.${t.upperCamelCase}Service;\\n\\n\" +\n\n          \"@RequiredArgsConstructor\\n\" +\n          \"@Component\\n\" +\n          \"@Log4j2\\n\" +\n          \"public class ${t.upperCamelCase}ApprovalEventListener implements ApplicationListener<ApprovalEvent> {\\n\"+\n          \"    /**\\n\" +\n          \"     * 审批流ID\\n\"+\n          \"     */\\n\"+\n\"    private static final String APPROVAL_NO = \\\"${applyId}\\\";\\n\\n\"+\n\"    final private ${t.upperCamelCase}Service ${t.camelCase}Service;\\n\\n\" +\n\n    \"    @Override\\n\"+\n\"    @Async\\n\"+\n\"    public void onApplicationEvent(ApprovalEvent event) {\\n\"+\n\"        ApprovalProcessOrder order = (ApprovalProcessOrder) event.getSource();\\n\"+\n\"        //检查师傅为当前对应审批流\\n\"+\n\"        if(!event.getApprovalProcessNo().equals(APPROVAL_NO)) {\\n\"+\n\"            return;\\n\"+\n\"        }\\n\"+\n\"        //处理业务逻辑，　修改样例状态为审批通过\\n\"+\n\"        if(order.getStatus() == 1) {\\n\"+\n\"            ${t.upperCamelCase} ${t.camelCase} = ${t.camelCase}Service.getById(order.getOutNo());\\n\"+\n\"            if(${t.camelCase} != null) {\\n\"+\n\"                if(order.getApplyStatus() == 2) {\\n\"+\n\"                    //审批通过\\n\"+\n\"                    ${t.camelCase}.setStatus(1);\\n\"+\n\"                } else if(order.getApplyStatus() == 1){\\n\"+\n\"                    //审批拒绝\\n\"+\n\"                    ${t.camelCase}.setStatus(2);\\n\"+\n\"                }\\n\"+\n    //TODO 根据唯一ID进行更新\n\"                ${t.camelCase}Service.updateById(${t.camelCase});\\n\"+\n\"            } else {\\n\"+\n\"                log.error(\\\"无效审批单: {}\\\", event);\\n\"+\n\"            }\\n\"+\n\"        } else {\\n\"+\n\"            log.info(\\\"审批中间环节： {}\\\", event);\\n\"+\n\"        }\\n\"+\n\"    }\"\n\n  code += \"\\n}\"\n  \n  code\n}','2022-12-31 01:02:37',1),(1170362388,1736609793,'enums','Java枚举生成',1,'//页面生成模板\ndef main(t) {\n  def str = \"\" + getFileName(t) + \"\\n--------------------------\\n\" +  getCode(t)\n  str\n}\n\ndef getFileName(tableVo) {\n  def tool = shell.parse(context.codeTableTemplateService.getById(1).code)\n  def t = tool.calcTable(tableVo)\n  \"src/main/java/\" + baseNamespace.replace(\".\", \"/\") + \"enums/\" +\n  \"${t.upperCamelCase}Enums.java\"\n}\n\ndef getCode(t) {\n  createCode(t)\n} \n\n\ndef createCode(tableVo) {\n  def tool = shell.parse(context.codeTableTemplateService.getById(1).code)\n  def t = tool.calcTable(tableVo)\n  def fields = t.fiel