\\nparentName=\" + parentName)\n\n    def fields = t.fields\n    def  code = \"\"\n\n    code += \"\"\"\nimport React from \'react\';\nimport { DownOutlined,PlusOutlined,EditOutlined,DeleteOutlined } from \'@ant-design/icons\';\nimport { App, Button, Tree } from \'antd\';\nimport { Space } from \'antd\';\nimport { useEffect } from \'react\';\nimport {addRootNode} from \'@/utils/tree\';\nimport { Trans, useLingui } from \"@lingui/react/macro\"\n\n// 加载树形数据\nconst loadTree = (parentId, map, parentList) => {\n  let sons = []\n  if(parentList[parentId] == null) {\n    return sons;\n  }\n  parentList[parentId].map((item)=>{\n    //检查是否有子结点\n    let currentData = {\n      key: item.${idName},\n      title: item.${titleName}\n    }\n    if(parentList[item.${idName}] != null) {\n      currentData[\'children\'] = loadTree(item.${idName}, map, parentList)\n    }\n    sons.push(currentData)\n  })\n  return sons;\n}\n\nconst loadDataFromList = (list) => {\n  let map = {}\n  let parentList = {}\n  if(list && list.length > 0) {\n    list.map((item)=>{\n    map[item.id] = item\n      if(parentList[item.${parentName}] == null) {\n        parentList[item.${parentName}] = []\n      }\n      parentList[item.${parentName}].push(item)\n    })\n  }\n  return {map: map, parentList: parentList}\n}\n\nconst nothing = ()=>{}\n\nexport default (props) => {\n  const {data=[],baseState={},\n  onEditItem=nothing,onDeleteItem=nothing\n} = props;\n  const {list=[]} = baseState;\n  const [treeData, setTreeData] = React.useState([]);\n  const [map, setMap] = React.useState(null);\n  const [parentList, setParentList] = React.useState(null);  \n  const { modal,notification } = App.useApp();\n  const { i18n, t } = useLingui();\n\n  // 初始化树形数据\n  useEffect(() => {\n    const {map, parentList} = loadDataFromList(list?.list);\n    let tree = loadTree(0, map, parentList)\n    setTreeData(addRootNode(tree));\n    setMap(map);\n    setParentList(parentList);\n  }, [list]);\n\n  const onSelect = (selectedKeys, info) => {\n    console.log(\'selected\', selectedKeys, info);\n  };\n\n  // 渲染树形标题\n  const renderTitle = (title, key) => {\n    return (\n      <Space style={{gap: \'50px\'}}>\n        {title}\n        <Space size={1}>\n          <Button type=\'link\' onClick={()=>{\n            const item = map[key];\n            onEditItem({parentId: key, title: \'\'});\n          }} icon={<PlusOutlined />} />\n          {key!=0 && <Button type=\'link\' onClick={()=>{\n            const item = map[key];\n            onEditItem(item);\n          }} icon={<EditOutlined />} />}\n          {key!=0 && <Button type=\'link\' onClick={()=>{\n            const item = map[key];\n            // 检查是否有子节点\n            if(parentList[item.${idName}] && parentList[item.${idName}].length > 0) {\n              notification.warning({\n                message: t(\"Cannot delete this record, it has child records\"),\n              });\n              return;\n            }\n            modal.confirm({\n              title: t(\"Are you sure delete this record?\"),\n              onOk() {\n                onDeleteItem(item)\n              },\n            })\n          }} icon={<DeleteOutlined />} />}\n        </Space>\n      </Space>\n    );\n  };\n\n  return <>\n    {map && <Tree\n      showLine\n      titleRender={(node) => renderTitle(node.title, node.key)}\n      switcherIcon={<DownOutlined />}\n      // defaultExpandedKeys={[\'0-0-0\']}\n      // onSelect={onSelect}\n      treeData={treeData}\n      defaultExpandAll={true}\n      // expandedKeys={Object.keys(map || {})}\n      // expandedKeys={keys}\n    />}\n  </>\n};\n\"\"\"\n\n    code\n}','2025-05-27 09:28:38',1),(1170362409,-1606283262,'antd5ExtendedComponents','扩展组建入口文件',1,'//页面生成模板\ndef main(t) {\n  def str = \"\" + getFileName(t) + \"\\n--------------------------\\n\" +  getCode(t)\n  str\n}\n\ndef getFileName(tableVo) {\n  def tool = shell.parse(context.codeTableTemplateService.getById(1).code)\n  def t = tool.calcTable(tableVo)\n  \"src/pages/\"+t.name+\"/components/ExtendedComponents.jsx\"\n}\n\ndef getCode(t) {\n  createCode(t)\n}\n\n\ndef createCode(tableVo) {\n  def tool = shell.parse(context.codeTableTemplateService.getById(1).code)\n  def t = tool.calcTable(tableVo)\n  def fields = t.fields\n  def  code = \"\"\n\n//  fields.each() {\n//    code += \",${it.name}\"\n//  }\n\n  code +=\"\"\"import { useState, useEffect } from \"react\";\nimport { useLingui } from \"@lingui/react/macro\";\nimport { Operation } from \'@/component/list\'\n\nconst loadFirstModule = (modules, defaultValue) => {\n  try {\n    const moduleKeys = Object.keys(modules);\n    \n    if (moduleKeys.length === 0) {\n      return defaultValue;\n    }\n    \n    // 加载第一个匹配的模块\n    const module = modules[moduleKeys[0]];\n    return module.default || defaultValue;\n  } catch (error) {\n    return defaultValue;\n  }\n}\n\n// 导出过滤器操作按钮\nexport const filterButtons = loadFirstModule(import.meta.glob(\'./filter/buttons/index.jsx\', { eager: true }), {});\n\nconst operationButtons = loadFirstModule(import.meta.glob(\'./list/operations/index.jsx\', { eager: true }), {});\n// 扩展列表操作按钮\nexport const ExtendedOperation = (props) => {\n  const {children,onMenuClick,menuOptions, record} = props\n  const {i18n, t} = useLingui();\n  const [state, setState] = useState({})\n  const [clickHandler, setClickHandler] = useState({})\n\n  let items = Object.values(state)\n\n  // 子组件注册菜单回调\n  const registerItem = (item, handle) => {\n    let key = item?.key\n    if(!key) {\n      console.error(\"请传递正确操作选项数据\", item)\n      return\n    }\n    setState((prev)=>{\n      let data = {...prev}\n      data[key] = item\n      return data\n    })\n\n    setClickHandler((prev)=>{\n      let data = prev;\n      data[key] = (e) => handle(record, e)\n      return data;\n    })\n  }\n\n  // 下拉操作点击事件\n  const handleMenuClick = (e) => {\n     // default   onMenuClick\n     let handle = ()=>{}\n     if(clickHandler[e.key]) {\n      handle = clickHandler[e.key]\n     } else {\n      handle = onMenuClick\n    }\n    // 触发操作\n    handle(e)\n  }\n\n  return <>\n            <Operation\n              onMenuClick={handleMenuClick}\n              menuOptions={[\n                // 低代码生成选项\n                ...menuOptions,\n                // 扩展选项\n                ...Object.values(state)\n              ]}\n            />\n                        {Object.values(operationButtons).map((Component, index) => (\n                                      <Component registerItem={registerItem} key={`menu-action-\\${index}`} />\n                                    ))}\n  </>\n}\n\n// 扩展列表批量操作按钮\nconst batchOperationButtons = loadFirstModule(import.meta.glob(\'./list/batchOperations/index.jsx\', { eager: true }), {});\nexport const BatchOperation = (props) => {\n  const {children,selectedRowKeys=0} = props;\n  return <>\n    {children}\n    {/* 其他的操作按钮扩展 */}\n    {Object.values(batchOperationButtons).map((Component, index) => (\n              <Component selectedRowKeys={selectedRowKeys} key={`list-batch-action-\\${index}`} />\n            ))}\n  </>\n}\n\n// 处理表单扩展\nconst formItems = loadFirstModule(import.meta.glob(\'./form/item/index.jsx\', { eager: true }), {})\nexport const FormExtendItems = (props) => {\n  return <>\n    {Object.values(formItems).map((Component, index) => (\n              <Component\n                key={`form-item-\\${index}`}\n                {...props}\n                />\n            ))}\n  </>\n}\n\"\"\"\n\n  code\n}','2025-06-02 21:08:22',1),(1170362410,1715638274,'test','test',1,'// 用来单纯测试的  可以删除','2025-06-07 14:32:18',1),(1170362411,1459777537,'vue3-apis','接口定义',1,'//页面生成模板\ndef main(t) {\n  def str = \"\" + getFileName(t) + \"\\n--------------------------\\n\" +  getCode(t)\n  str\n}\n\ndef getFileName(tableVo) {\n  def tool = shell.parse(context.codeTableTemplateService.getById(1).code)\n  def t = tool.calcTable(tableVo)\n  \"src/apis/modules/\"+ t.name +\".js\"\n}\n\ndef getCode(t) {\n  createCode(t)\n}\n\n\n//创建model文件