eignTableName)}/admin/${it.foreignTableLowerCamelCaseName}/tree`,\\n\"\n          }\n      }\n    }\n\n    // 输出excel相关接口\n    //   queryExampleExportExcel: `GET /admin/example/exportExcel`,\n    //  createExampleImportExcel: `POST /admin/example/importExcel`,\n    if(tool.isExistsApi(apis, \"importExcel\")) {\n        code += \" create${t.upperCamelCase}ImportExcel: `POST ${apiPrefix}/admin/${t.camelCase}/importExcel`,\\n\"\n    }\n    if(tool.isExistsApi(apis, \"exportExcel\")) {\n        code += \" query${t.upperCamelCase}ExportExcel: `GET ${apiPrefix}/admin/${t.camelCase}/exportExcel`,\\n\"\n    }\n\n\n    // 去掉最后一个,\n    if (code.endsWith(\",\\n\")) {\n      code = code.substring(0, code.length() - 2)\n    }\n\n    code += \"\\n}\"\n}','2025-06-18 19:51:49',1),(1170362412,1459777537,'vue3-editorModal','编辑弹窗组建',1,'//前端编辑框\ndef main(t) {\n  def str = \"\" + getFileName(t) + \"\\n--------------------------\\n\" +  getCode(t)\n  str\n}\n\ndef getFileName(tableVo) {\n  def tool = shell.parse(context.codeTableTemplateService.getById(1).code)\n  def t = tool.calcTable(tableVo)\n  \"src/pages/\" + t.name + \"/components/modalComponent.vue\"\n}\n\ndef getCode(t) {\n  createCode(t)\n}\n\n\ndef createCode(tableVo) {\n  def tool = shell.parse(context.codeTableTemplateService.getById(1).code)\n  def t = tool.calcTable(tableVo)\n  def fields = t.fields\n  def  code = \"\"\n\n  code += \"\"\"\n<template>\n  <a-modal\n    v-model:visible=\"modalVisible\"\n    :title=\"title\"\n    :confirm-loading=\"confirmLoading\"\n    :width=\"modalWidth\"\n    :destroy-on-close=\"true\"\n    @ok=\"handleOk\"\n    @cancel=\"handleCancel\"\n  >\n    <a-form\n      ref=\"formRef\"\n      :model=\"formState\"\n      :label-col=\"{ span: 4 }\"\n      :wrapper-col=\"{ span: 20 }\"\n      :rules=\"rules\"\n    >\n\"\"\"\n  // 循环编辑字段\n  fields.each() {\n    if(it.editHidden == \"true\" || it.camelCase == \'id\' ||  it.camelCase == \'createdTime\' || it.camelCase == \'updatedTime\') {\n      return