'${entry.value}\',\"\n          )\n        }\n      }\n      code += (\"},\\n\")\n    }\n  }\n  code += \"\"\"\n  },\n\"\"\"\n  // optionValueLabel\n  code += \"\"\"\n  optionValueLabel: {\n\"\"\"\n\n  fields.each() {\n    if(it.frontType == \'select\' || it.frontType == \'checkbox\' || it.dict != \'\') {\n      def foreign = tool.getExtendData(it.comment, \'foreign\', null)\n\n      code += (\n              \"        ${it.camelCase}: [\")\n      if(!foreign && it.dict == \'\') {\n        def comment = it.comment\n        def options = tool.getOptions(comment)\n        options.each {entry ->\n          code += (\n                  \"{value: \'${entry.key}\', label:\'${entry.value}\'},\"\n          )\n        }\n      }\n      code += (\"],\\n\")\n    }\n  }\n\n  code += \"\"\"\n  },\n\"\"\"\n  // trees\n  code += \"\"\"\n  trees: {\n\"\"\"\n  fields.each() {\n    if(it.frontType == \'tree\') {\n      code += \"\"\"\n    ${it.name}: []\n\"\"\"\n    }\n  }\n  code += \"\"\"\n  },\n\"\"\"\n\ncode += \"\"\"\n})\n\n// 搜索框相关数据\nconst searchProps = ref({\n  search: (params) => {\n    console.log(\'父组件搜索参数\', params);\n    loadData(params);\n  }\n})\n\nconst listProps = ref({\n  listData: [],\n  handleDelete: (record) => {\n    Modal.confirm({\n      content: t(\"Are you sure delete this record?\"),\n      onOk() {\n        apis.delete${t.upperCamelCase}({ids: record.id}).then(() => {\n          message.success(t(\'Delete success\'));\n          requestList(route.query);\n        }).catch(err => {\n          message.error(t(\'Delete failed\'));\n        });\n      },\n      onCancel() {\n        console.log(\'取消删除\');\n      }\n    });\n  },\n  onEdit: (record) => {\n    modalProps.value.visible = true;\n    modalProps.value.formData = record;\n  },\n  pagination: {\n    current: 1,\n    pageSize: 10,\n    total: 0\n  },\n  paginationChange: (pagination) => {\n    const page = pagination.current || 1;\n    const pageSize = pagination.pageSize || 10;\n    loadData({ page, pa