d]) {\n      currentData.children = loadTree(item.id, map, parentList);\n    }\n    \n    sons.push(currentData);\n  });\n  \n  return sons;\n};\n\nconst loadDataFromList = (list) => {\n  let map = {};\n  let parentList = {};\n  \n  if (list && list.length > 0) {\n    list.forEach((item) => {\n      map[item.id] = item;\n      \n      if (!parentList[item.parentId]) {\n        parentList[item.parentId] = [];\n      }\n      \n      parentList[item.parentId].push(item);\n    });\n  }\n  \n  return { map, parentList };\n};\n\n// Initialize tree data\nwatch(() => props.listData, (newList) => {\n  const { map: newMap, parentList: newParentList } = loadDataFromList(newList?.list);\n  let tree = loadTree(0, newMap, newParentList);\n  treeData.value = addRootNode(tree);\n  map.value = newMap;\n  parentList.value = newParentList;\n}, { immediate: true });\n\nconst handleAdd = (key) => {\n  const item = map.value[key];\n  props.onEdit({ parentId: key, title: \'\' });\n};\n\nconst handleEdit = (key) => {\n  const item = map.value[key];\n  props.onEdit(item);\n};\n\nconst handleDelete = (key) => {\n  const item = map.value[key];\n  // Check if it has children\n  if (parentList.value[item.id] && parentList.value[item.id].length > 0) {\n    notification.warning({\n      message: t(\"Cannot delete this record, it has child records\"),\n    });\n    return;\n  }\n  \n  Modal.confirm({\n    title: t(\"Are you sure delete this record?\"),\n    onOk() {\n      props.handleDelete(item);\n    },\n  });\n};\n</script>\n\"\"\"\n}','2025-06-25 02:33:50',1),(1170362417,1459777537,'vue3-extendedComponents','扩展组件入口',1,'//页面生成模板\ndef main(t) {\n    def str = \"\" + getFileName(t) + \"\\n--------------------------\\n\" +  getCode(t)\n    str\n}\n\ndef getFileName(tableVo) {\n    def tool = shell.parse(context.codeTableTemplateService.getById(1).code)\n    def t = tool.calcTable(tableVo)\n    \"src/pages/\"+ t.name +\"/components/extendedComponents.js\"\n}\n\ndef getCode(t) {\n    createCode(t)